import {
  Navbar,
  Nav,
  NavDropdown,
} from "react-bootstrap";
import { Link } from "react-router-dom";
import LogInLink from "./LogInLink";
import LogOutLink from "./LogOutLink";
import authServices from "../../store/services/authServices";

const Navbarpage = () => {
  console.log(authServices().username);
  return (
    <div className="container">
      <Navbar expand="lg" bg="primary" variant="dark">
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse>
          <Nav className="mr-auto">
            <Nav.Link as={Link} to="/home" style={{ color: "white", fontWeight: "bold" }}>
              Home
            </Nav.Link>
            <NavDropdown title="Covid Cases">
              <NavDropdown.Item as={Link} to="/confirm" style={{ color: "white", fontWeight: "bold" }}>
                Confirmed
              </NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/death" >
                Deaths
              </NavDropdown.Item>
            </NavDropdown>

            <NavDropdown title="Vacination">
              <NavDropdown.Item as={Link} to="/vacination">
                Vacination
              </NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/vacinationMap">
                Maps
              </NavDropdown.Item>
            </NavDropdown>

            <Nav.Link as={Link} to="/recovery" style={{ color: "white" }}>
              Recovery
            </Nav.Link>
            <Nav.Link
              as={Link}
              to="/mystories"
              style={{ color: "white", fontWeight: "bold" }}
            >
              My Stories
            </Nav.Link>
          </Nav>
          <Nav>
            {authServices().username === undefined ? (
              <LogOutLink />
            ) : (
              <LogInLink />
            )}
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default Navbarpage;
